import React from 'react'
import { Link } from 'react-router-dom'

export default function IdeaThumb({ idea }) {
    const url = `/ideas/${idea._id}`
    return (
        <Link to={url}>
            <div>
                <h3>{idea.title}</h3>
            </div>
        </Link>
    )
}
